import { Container} from "reactstrap";

class Header extends React.Component {
  render() {
    return (
      <>
        <div className="header bg-gradient-info pb-8 pt-5 pt-md-11">
          <p className='text-right text-white'>dfdfdfd</p>
          <Container fluid>
            <div className="header-body">

            </div>
          </Container>
        </div>
      </>
    );
  }
}

export default Header;
